import React from "react";
import { Routes, Route, Navigate } from "react-router-dom";
import { useAuthStore } from "./stores/authStore";
import { NotificationProvider } from "./contexts/NotificationContext";
import Header from "./components/layout/Header";
import Footer from "./components/layout/Footer";
import Home from "./pages/Home";
import About from "./pages/About";
import ONGs from "./pages/ONGs";
import Content from "./pages/Content";
import Actions from "./pages/Actions";
import ActionDetails from "./pages/ActionDetails";
import Notifications from "./pages/Notifications";
import LoginModal from "./components/auth/LoginModal";
import ProtectedRoute from "./components/auth/ProtectedRoute";
import VolunteerLayout from "./components/volunteer/VolunteerLayout";
import VolunteerDashboard from "./pages/volunteer/Dashboard";
import VolunteerProfile from "./pages/volunteer/Profile";
import VolunteerApplications from "./pages/volunteer/MyApplications";
import VolunteerCertificates from "./pages/volunteer/Certificates";
import ONGLayout from "./components/ong/ONGLayout";
import ONGDashboard from "./pages/ong/Dashboard";
import ONGProfile from "./pages/ong/Profile";
import ONGActions from "./pages/ong/MyActions";
import ONGApplications from "./pages/ong/Applications";

function App() {
  const { isAuthenticated, userType } = useAuthStore();

  return (
    <NotificationProvider>
      <div className="bg-white">
        {/* Header Global */}
        <Header />

        {/* Conteúdo Principal */}
        <main>
          <Routes>
            {/* Rotas Públicas */}
            <Route path="/" element={<Home />} />
            <Route path="/quem-somos" element={<About />} />
            <Route path="/ongs" element={<ONGs />} />
            <Route path="/conteudos" element={<Content />} />
            <Route path="/acoes" element={<Actions />} />
            <Route path="/acao/:id" element={<ActionDetails />} />
            <Route path="/notificacoes" element={<Notifications />} />

            {/* Rotas Protegidas - Voluntário */}
            <Route
              path="/voluntario"
              element={
                <ProtectedRoute
                  isAuthenticated={isAuthenticated}
                  userType={userType}
                  allowedType="volunteer"
                  redirectTo="/"
                >
                  <VolunteerLayout>
                    <VolunteerDashboard />
                  </VolunteerLayout>
                </ProtectedRoute>
              }
            />
            <Route
              path="/voluntario/perfil"
              element={
                <ProtectedRoute
                  isAuthenticated={isAuthenticated}
                  userType={userType}
                  allowedType="volunteer"
                  redirectTo="/"
                >
                  <VolunteerLayout>
                    <VolunteerProfile />
                  </VolunteerLayout>
                </ProtectedRoute>
              }
            />
            <Route
              path="/voluntario/minhas-aplicacoes"
              element={
                <ProtectedRoute
                  isAuthenticated={isAuthenticated}
                  userType={userType}
                  allowedType="volunteer"
                  redirectTo="/"
                >
                  <VolunteerLayout>
                    <VolunteerApplications />
                  </VolunteerLayout>
                </ProtectedRoute>
              }
            />
            <Route
              path="/voluntario/certificados"
              element={
                <ProtectedRoute
                  isAuthenticated={isAuthenticated}
                  userType={userType}
                  allowedType="volunteer"
                  redirectTo="/"
                >
                  <VolunteerLayout>
                    <VolunteerCertificates />
                  </VolunteerLayout>
                </ProtectedRoute>
              }
            />

            {/* Rotas Protegidas - ONG */}
            <Route
              path="/ong"
              element={
                <ProtectedRoute
                  isAuthenticated={isAuthenticated}
                  userType={userType}
                  allowedType="ong"
                  redirectTo="/"
                >
                  <ONGLayout>
                    <ONGDashboard />
                  </ONGLayout>
                </ProtectedRoute>
              }
            />
            <Route
              path="/ong/perfil"
              element={
                <ProtectedRoute
                  isAuthenticated={isAuthenticated}
                  userType={userType}
                  allowedType="ong"
                  redirectTo="/"
                >
                  <ONGLayout>
                    <ONGProfile />
                  </ONGLayout>
                </ProtectedRoute>
              }
            />
            <Route
              path="/ong/minhas-acoes"
              element={
                <ProtectedRoute
                  isAuthenticated={isAuthenticated}
                  userType={userType}
                  allowedType="ong"
                  redirectTo="/"
                >
                  <ONGLayout>
                    <ONGActions />
                  </ONGLayout>
                </ProtectedRoute>
              }
            />
            <Route
              path="/ong/aplicacoes"
              element={
                <ProtectedRoute
                  isAuthenticated={isAuthenticated}
                  userType={userType}
                  allowedType="ong"
                  redirectTo="/"
                >
                  <ONGLayout>
                    <ONGApplications />
                  </ONGLayout>
                </ProtectedRoute>
              }
            />

            {/* Rota 404 */}
            <Route path="*" element={<Navigate to="/" replace />} />
          </Routes>
        </main>

        {/* Footer Global */}
        <Footer />

        {/* Modal de Login Global */}
        <LoginModal />
      </div>
    </NotificationProvider>
  );
}

export default App;
